import wnioski from "../../../static/pagedata/wnioski";
import { useState, useEffect } from "react";

const ToDownload = () => {
  const [forms, setForms] = useState([]);

  useEffect(() => {
    getForms();
  });

  const getForms = () => {
    setForms(wnioski.interaktywne.formularze);
  };
  return (
    <div className="grey-box">
      {forms.map((form) => (
        <FormBar name={form} />
      ))}
    </div>
  );
};

export default ToDownload;
